class Footer extends Component {
  render() {
    return (
      <footer className="Footer">
        <h4 className="names">
          <img
            className="linkedin"
            src="https://i.imgur.com/3Qrizh4.png"
            alt="Linkedin Link"
          />
          Lauren Carne & Miao Shan
          <img
            className="linkedin"
            src="https://i.imgur.com/3Qrizh4.png"
            alt="Linkedin Link"
          />
        </h4>
        <h5 className="copyright"> &copy; Copyright 2019 Flatiron School </h5>
      </footer>
    );
  }
}

export default Footer;
